import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { connect } from "react-redux";
import { logoutUser } from "../../utilities/actions/auth";
import AppButton from "../../components/UI/AppButton";
import { ScrollView } from "react-native-gesture-handler";
import Header from "../../components/Header";
import appValues from "../../constants/appValues";
import ProfileItem from "./components/ProfileItem";
import architects from "../../data/architects";
// import { HeaderTitle } from "@react-navigation/stack";

function Home(props) {
  return (
    <View>
      <ScrollView>
        <Header>Architects</Header>
        <Text style={{ fontSize: appValues.font.h1 }}>Architects</Text>
        <AppButton title="Sign Out" onPress={() => props.logoutUser()} />
        {architects.map(
          ({ firstName, lastName, src, location, id, ...profile }) => (
            <ProfileItem
              key={profile.id}
              src={src}
              name={`${firstName} ${lastName}`}
              location={location}
            />
          )
        )}
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({});

const mapStateToProps = (state) => {
  const { auth } = state;
  return { auth };
};

const mapDispatchToProps = (dispatch) => {
  return {
    logoutUser: () => dispatch(logoutUser()),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Home);
